import React from 'react';
import './Login'

function LoginForm4() {
    return (
        <div className="loginform4">
            <form>
                <button></button>
                <input type="email" placeholder="Enter Email or Username"/>
                <input type="password" placeholder="Enter Password"/>
                <br/>
                <button>Login</button>
            </form>
        </div>
    )
}

export default LoginForm4
